import React from 'react'
import {
    Card, CardBody,
    CardTitle, CardSubtitle, CardDeck, CardText, CardImg
  } from 'reactstrap';


export default function Comment (props) {

    const { info } = props

    return (

       <CardDeck>

           <Card style={{ backgroundColor: '#f6f6ef', borderRadius: '25px', 
           width: '25%', margin: "10px"}}>
            <CardBody inverse style= {{color: 'black'}}>
                <CardTitle>Username: {info.UserName}</CardTitle>
                <CardSubtitle>Salty Score: {info.SaltyScore}</CardSubtitle>
            </CardBody>
                <CardImg />
            <CardBody>
                    <CardText>Comment: {info.Comment}</CardText>
            </CardBody>   
        </Card>

    </CardDeck>




    )


}
